(19511, 315, 0, 1, 'Where To Go', '我想我會說未來已經不會太遠了\r\n但我們從來沒有像現在一樣如此的感傷\r\n\r\n我不會停留，因為我們已經在半路上了\r\n雖然這裡並沒有所謂的歸屬\r\n所以還是請告訴我該往哪兒走\r\n\r\n所以請讓我知道什麼時候是這場表演該結束的時機\r\n如果已經沒有下一次機會了呢？\r\n所以請讓我知道人生的終極目標是什麼\r\n如果我們早已經錯過了我們想要的？', '0000-00-00 00:00:00', 2000, 0, 1, 7, 'I would say We are on the way\r\nBut we never felt so sad\r\nLike this time\r\n\r\nI won''t stay We are on the way\r\nThough there''s no final home\r\nSo tell me where to go\r\n\r\nSo let me know when is the end of this show\r\nAnd what if there''s no another on e\r\nSo let me know what is the target of this life\r\nAnd what if we''ve already missed what we want', '', 186, '', '', '', '', '', '', 0, 0, 1, '2009-10-22 15:00:54', '2013-10-07 17:15:15', '0000-00-00 00:00:00'),
