(19513, 10485, 0, 1, '過程(DEMO)', '', '2011-04-10 00:00:00', 2000, 0, 2, 7, '藍色 黑色 紅色 黃色的夢\r\n笑臉 淚水 憤怒 各種面容\r\n如同窗外的  景色遠走\r\n                                                                                \r\n一樣 的歌 不同 人點播\r\n一樣 的人 卻無 話可說\r\n各種過程 只是遊戲不須疑惑\r\n                                                                                \r\n有一天我們不再言說\r\n踏著路前進夢的路口\r\n不再寫出歪七扭八的字\r\n用力的衝  不曾回頭\r\n                                                                                \r\n有一天我們不再感動\r\n不再為受挫失戀淚流\r\n偽裝堅強卻無法掩飾\r\n我的失落\r\n', '', 263, '', '', '', '', '', '', 1, 0, 0, '2009-10-23 16:18:27', '2015-03-12 13:40:13', '0000-00-00 00:00:00'),
