(19515, 10485, 0, 1, 'Seven (DEMO)', '', '2011-04-10 00:00:00', 2000, 0, 2, 4, '喜歡聽你的聲音\r\n習慣看你的表情\r\n握著溫暖的手心\r\n離開了混亂的思緒\r\n\r\n在多年之後 我會想念 你的溫柔 \r\n不曾寂寞 有你陪著我 現在到以後\r\n\r\n離別的夜空 滿天星斗 感覺依舊\r\n抱著你說 請你要記得 請你要記得我\r\n\r\n天空不會再哭泣\r\n塵埃終究會平息\r\n上天給我們勇氣\r\n而你照亮我的生命', '', 281, '', '心機', '心機', '激情睫毛', '', '', 1, 0, 0, '2009-10-23 16:20:23', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
(19516, 10485, 0, 1, '使命感', '', '2011-04-10 00:00:00', 2000, 0, 1, 10, '天空又下起大雨\r\n關上了窗做個決定\r\n不想當個大明星 太矯情\r\n\r\n隨手關上冷氣機\r\n熱得好想跳進海裡\r\n新世代的使命感不能忘記\r\n\r\n地平線 在哪裡 我站著 看不清\r\ngive it walk\r\ngive it passion\r\n\r\n日記裡的孩子氣 招喚我的熱情\r\nlet it work \r\ndo something', '', 224, '', '', '', '', '', '', 1, 0, 0, '2009-10-23 16:21:06', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
