(19540, 13299, 0, 1, '貓不睡', '', '0000-00-00 00:00:00', 0000, 0, 1, 7, '咖啡杯 輕音樂 寂寞草 又一夜\r\n脖子上的項圈 掛著絨絨思念 妳坐在對面 微笑\r\n肖像權 香水味 燭光下 糖果戀\r\n眼神透出詩意 黑白相間的貓 喵喵喵喵喵 地叫\r\n\r\n貓不睡 陪我失眠 看我為誰愚昧\r\n貓不懂 我也懶得說 牠們活得太輕鬆\r\n貓不睡 卻打呵欠 我才明白因為\r\n貓不屑 愛情的滋味 以及無聊的人類\r\n\r\n貓不睡 在妳面前 \r\n貓不睡 望著妳的臉 猜你對我沒感覺', '', 200, '', '茵', '熱拿鐵', '', '', '', 0, 1, 0, '2009-10-25 14:45:30', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
(19541, 15514, 0, 1, '下雨天', '', '0000-00-00 00:00:00', 2009, 0, 2, 7, '下雨天\r\n\r\n聽著雨一直下下下下   看著人一直走走走走\r\n只有我還在這裡發呆   幻想著電影裡的情節對白\r\n我還在這裡想想想想   時間卻已經走走走走\r\n所謂夢想  到底該怎麼想   是否只要勇敢去闖\r\n\r\n高高城牆  就檔在前方\r\n是不是突破了就有天堂\r\n是誰說  人因夢想而偉大\r\n誰又說  肚子填飽了嗎?\r\n\r\n聽著雨一直下下下下   看著人一直走走走走\r\n只有我還在這裡發呆   等不到電影裡的情節對白\r\n我還在這裡想想想想   時間卻已經走走走走\r\n所謂夢想  不該只是空想   是否努力就能如願以償\r\n\r\n長長的路  就等在前方\r\n能不能走到終點沒人能講\r\n是誰說  人要有自知之明\r\n不試試看又怎麼知道不行\r\n\r\n走吧走吧  走吧走吧\r\n邁開步伐  有夢就不怕\r\n雨一直下  我相信烏雲背後彩虹等在那\r\n\r\n小小夢想  在心中發芽\r\n等待機會  茁壯長大\r\n溫暖的陽光照在身上\r\n把手牽好  出  發', '', 207, '', 'mimic', '木偶/mimic', '', '', '', 0, 0, 1, '2009-10-25 14:47:33', '2013-10-07 17:15:16', '0000-00-00 00:00:00'),
(19542, 15514, 0, 1, '下雨天', '', '0000-00-00 00:00:00', 2009, 0, 2, 7, '聽著雨一直下下下下   看著人一直走走走走\r\n只有我還在這裡發呆   幻想著電影裡的情節對白\r\n我還在這裡想想想想   時間卻已經走走走走\r\n所謂夢想  到底該怎麼想   是否只要勇敢去闖\r\n\r\n高高城牆  就檔在前方\r\n是不是突破了就有天堂\r\n是誰說  人因夢想而偉大\r\n誰又說  肚子填飽了嗎?\r\n\r\n聽著雨一直下下下下   看著人一直走走走走\r\n只有我還在這裡發呆   等不到電影裡的情節對白\r\n我還在這裡想想想想   時間卻已經走走走走\r\n所謂夢想  不該只是空想   是否努力就能如願以償\r\n\r\n長長的路  就等在前方\r\n能不能走到終點沒人能講\r\n是誰說  人要有自知之明\r\n不試試看又怎麼知道不行\r\n\r\n走吧走吧  走吧走吧\r\n邁開步伐  有夢就不怕\r\n雨一直下  我相信烏雲背後彩虹等在那\r\n\r\n小小夢想  在心中發芽\r\n等待機會  茁壯長大\r\n溫暖的陽光照在身上\r\n把手牽好  出  發', '', 207, '', 'mimic', '木偶/mimic', '', '', '', 1, 1, 0, '2009-10-25 15:43:07', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
(19543, 15466, 0, 1, '阿媽的白頭鬃', '開始聽的時候不要嚇一跳喔!\r\n因為開頭是我阿媽唱的 :)\r\n阿媽唱歌的高頻很多 所以聽起來不是很溫柔 所以後製有幫阿媽調過頻率\r\n因為我阿媽是個標準大嗓門 聲音總是高八度! \r\n講電話時候粉大聲 怕人家聽不見的那種 XD\r\n而且幫阿媽錄音的時候 阿媽除了害羞還要緊張 呵呵! \r\n\r\n這是安妮創作生涯寫的第一首台語歌\r\n取材自小時候被阿媽帶大 跟阿媽相依為命的情景\r\n但是故事內容稍有不同\r\n這是為了配合歌曲中的情境\r\n(因為我現在還是有跟阿媽住一起~)\r\n但是大意就是感恩阿媽用她從黑頭髮長出白頭髮的時間養育我\r\n用健康硬朗到步履蹣跚的身體照顧我長大\r\n(>< 嗚 快哭了~)\r\n\r\n旋律是用小時候聽到大的台語歌的fu唱出來的\r\n其實我是講台語長大的小孩\r\n國小畢業之前都住在南投的竹山鎮 (小鎮姑娘來的啦 哈哈!)\r\n國中之後才到台北來唸書\r\n厚 故事好長~~不要一次講太多好了 下次再聊 :)\r\n\r\n唱的部分沒有錄到很好 \r\n因為趕著報名時間一個晚上錄完vocal混音趕出來的\r\n希望之後有空再重錄\r\n\r\n很開心這首歌得到98年台灣原創流行音樂大獎的河洛語組佳作\r\n這首歌的live演出影片-我們在敦南誠品店的演出\r\n可以在官網看到\r\nhttp://www.streetvoice.com/anniedora/', '0000-00-00 00:00:00', 2000, 0, 2, 6, '阿媽的白頭鬃\r\n詞/曲/Vocal:安妮 吉他/編曲:阿樊\r\n\r\n故鄉的暗暝，總是有尚光的月娘\r\n紅紅的庄仔厝，常常出現置阮夢中\r\n是阿媽手內抱著阮，站置亭仔跤\r\n講著古早的故事，唱著古早的歌\r\n\r\n阿爸跟阿母，置城市塊打拼\r\n很久，很久，嘸識返來看我\r\n是阿媽手內牽著阮，叫阮要好好仔走\r\n不管未來的路途是按怎，阮永遠是伊的心肝\r\n\r\n阮是阿媽的囝仔，伊用雙手把阮晟養大\r\n阮一工一工大漢，伊越行腳步踏越慢\r\n\r\n阮是阿媽的囝仔，我跟伊兩個人來作伴\r\n阮睏置伊的腳蔗背，抬頭就看見伊的白頭鬃 伊的白頭鬃\r\n\r\n大漢的時陣，我嘛到城市去打拼 \r\n很久，很久，嘸識返去看阿媽\r\n出外走奔這多冬，才知影只有伊是尚疼我\r\n想欲返去給伊擁，擱聽伊唱彼條囝仔歌\r\n\r\n阮是阿媽的囝仔，伊用雙手把阮晟養大\r\n阮一工一工大漢，伊越行腳步踏越慢\r\n\r\n阮是阿媽的囝仔，我跟伊兩個人來作伴\r\n阮睏置伊的腳蔗背，抬頭就看見伊的白頭鬃 \r\n阿媽的白頭鬃\r\n是我永遠的\r\n思念\r\n', '', 267, '', '安妮', '安妮', '', '', '', 0, 0, 1, '2009-10-26 00:00:29', '2013-10-07 17:15:16', '0000-00-00 00:00:00'),
