(19545, 15514, 0, 1, 'Pink Pink', '', '0000-00-00 00:00:00', 2009, 0, 2, 7, '穿上我最喜歡的布鞋  好像走進了童話世界\r\n相信用心就能夠感覺  甚至以為能改變這世界\r\n\r\n站上大人們的高跟鞋  努力穿梭在現實社會\r\n想要證明真心能被看見   雖然挫折  我不妥協\r\n\r\n拿掉眼鏡變開闊   剪去頭髮就沒煩惱\r\n換上我最愛的T-shirt   快樂自動報到\r\n\r\n含一支棒棒糖就能滿足  手拿著氣球就感到幸福\r\n現在的我是否還一樣   坐上旋轉木馬就能飛翔\r\n\r\n來不及吃完早餐就要忙   手拿著電話說也說不完\r\n好想停下腳步看一看   從前的我  快樂模樣\r\n\r\n擁抱就停止悲傷   牽著手充滿力量\r\n雖然世界不是我想像   真心是唯一信仰\r\n\r\n', '', 181, '', 'mimic', '木偶', '', '', '', 0, 1, 0, '2009-10-26 01:44:56', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
