(19568, 11231, 2076, 2, '绿色翅膀', '', '2009-01-01 00:00:00', 2009, 15, 0, 4, '陽光依然溫暖的 灑落床上 \r\n窗外傳來聲響 是鳥兒歌唱\r\n懶洋洋的撑起 在軟軟的床  \r\n風兒帶來清香 這完美早上\r\n      \r\n我想要追  陽光綻放 微笑臉龐 很燦爛\r\n鳥兒歌唱  蝶儿輕揚 窗外世界 多明朗\r\n我想飛翔  天空之上 放飛心情 任游蕩\r\n還有蝶儿  還有鳥兒 還有風兒 齊歌唱', '', 257, '', '劉向宇', '劉向宇', '劉向宇', '樂世界', '', 0, 0, 0, '2009-10-31 04:20:15', '2015-03-12 13:40:14', '0000-00-00 00:00:00'),
