(19583, 4611, 0, 1, '剛剛好', '', '0000-00-00 00:00:00', 2000, 0, 2, 4, '我帶上耳機然後再也聽不到\r\n慢慢地感覺遠離周圍的吵鬧\r\n最後一點一點地睡著\r\n\r\n而我太多餘沒有存在的必要\r\n有太多理由讓我沒辦法逃跑\r\n最後就再也走不掉\r\n\r\n我在擁擠的城市裡尋找安靜的落腳\r\n雖然沒有太多依靠可是寂寞剛剛好\r\n我想這都是我自尋煩惱任性的需要\r\n只要我還能保有我的驕傲\r\n就算沒有人能夠聽得到\r\n就算你也沒有聽到\r\n\r\n如果我消失要多久才能找到\r\n時間走太慢讓我覺得好無聊\r\n能不能給我一個擁抱\r\n\r\n不要再互相討好\r\n如果會覺得困擾\r\n我們都剛剛好的重要\r\n\r\n太過聰明的煩惱\r\n我卻不怎麼想要\r\n而現在的生活剛剛好', '', 214, '', '', '', '', '', '', 0, 1, 0, '2009-11-04 05:45:53', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19584, 19520, 2135, 7, '我是袋鼠', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, 'Can you give me a cup of coffee?\r\n\r\nNow it’s a battle to defeat\r\n\r\nIt’s a confusing anxious talking\r\n\r\nYour smile has told me that’s boring\r\n\r\nit seems hard to let you know how I care about you\r\n\r\npacks of beers can’t change my mind\r\n\r\nand I can quit my smoking life\r\n\r\nlots of words to say\r\n\r\nbut turned nothing when I saw your face\r\n\r\nmaybe few month later\r\n\r\nI can stop my love to you\r\n\r\nyou said it’s time to take a bath\r\n\r\nIt’s OK and next time I can be earlier\r\n\r\nWatch the TV alone every night\r\n\r\nI am kind and sincere but little absurd\r\n', '', 150, '', 'The Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:41:53', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19585, 19520, 2135, 2, 'A片少年', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '漲紅臉的男孩  在午後陽光\r\n\r\n想開啟溫柔的窗  填滿她的夏天\r\n\r\n下午三點  下起雨   騎樓邊\r\n\r\n別躲在角落落淚\r\n\r\ncause bitter is also a part of life\r\n\r\n青春縈繞在妳身上   黑色迷你裙\r\n\r\n汗水濕透妳的身體   粉白色的衣襟\r\n\r\n他用一把傘  想攔下  一瞬間\r\n\r\n匆忙淘氣的美麗   \r\n\r\ncause love is also a part of life\r\n\r\n看a片的少年  拉緊窗簾\r\n\r\n門外走過的母親   驚訝又擔心   \r\n\r\n歲月痕跡  三十年後   會不會     \r\n\r\n你仍替我推著輪椅 \r\n\r\nplease stay with me and complete the rest of life \r\n\r\n流洩不止的青春年少 la la da la da la la~\r\n\r\n小手中手黏滑或皺摺的手 la la da la da la la la la da la da la la\r\n', '', 241, '', 'the Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:43:26', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19586, 19520, 2135, 5, 'Song 4', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '溫水滑過臉頰\r\n\r\n低頭吐出白色的泡沫\r\n\r\n換上\r\n\r\n蓬鬆的睡衣  房間的另一個你\r\n\r\n向你說晚安\r\n\r\n洗髮精的味道讓你放心倒下\r\n\r\n慢慢走向光亮的櫥窗\r\n\r\n阿阿阿阿   別著急回來\r\n\r\n醒來的時候要記下那片段\r\n\r\n鈴聽收音機的叮嚀\r\n\r\n別忘了收好明天的雨衣 關心你\r\n\r\n喝一口熱茶\r\n\r\n懊惱下午不經意說錯的話\r\n\r\n那一份寧靜讓你放心倒下\r\n\r\n慢慢走向光亮的櫥窗\r\n\r\n好想快點走到那地方 \r\n', '', 213, '', 'The Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:44:49', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19587, 19520, 2135, 1, '機器人日記', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, 'Duplicate everything to your morning\r\n\r\nand we can work it out\r\n\r\nDa la la da la~\r\n\r\nDuplicate everything to your morning\r\n\r\nwith your smile and childlike face\r\n\r\n(bridge)\r\n\r\nEven if you''ve lost your god\r\n\r\nIt doesn''t matter\r\n\r\nEven if I''ve lost my mind\r\n\r\nEverything will still be fine\r\n\r\nDefect is the name of the world\r\n\r\nwhere we used to be here\r\n\r\n(chorus)\r\n\r\nAnd I can see the light but there''s no wonder\r\n\r\nWho leads us till  the end\r\n\r\nAnd I can feel the live but there''s no wonder\r\n\r\nTo fear and be futureless\r\n\r\ntill  the end\r\n', '', 220, '', 'The Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:46:13', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19588, 19520, 2135, 8, 'Drugs Don''t Work', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '不要再電視上轉動你的頭\r\n\r\n我知道你想幹什麼\r\n\r\n獅子的鬃毛虧你想得到\r\n\r\n我不覺得這很好笑\r\n\r\n我只好一天一天一天一天\r\n\r\n吃下我的藥\r\n\r\n我姐姐建議我買頂假髮\r\n\r\n然後不要跟人結怨\r\n\r\n女朋友說光頭也很帥 \r\n\r\n但別帶笑著跟我說\r\n\r\n我只好一天一天一天一天\r\n\r\n吃下我 的藥\r\n\r\n\r\n光陰的故事\r\n\r\n聰明絕頂\r\n\r\nxxxxx\r\n\r\nxxxxx', '', 170, '', 'The Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:47:18', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19589, 19520, 2135, 3, 'If I Disappear', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '(verse)\r\n\r\nIf I disappear\r\n\r\nWill you be great ?\r\n\r\nIf I leave you\r\n\r\nShall you be great ?\r\n\r\nCause we have become different pieces.\r\n\r\nCause time has blown us away and we are apart.\r\n\r\n(chorus)\r\n\r\nla la la la la la la la la X4', '', 303, '', 'the Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:51:07', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19590, 19520, 2135, 6, '工作狂', '這是我們的生活。', '2009-11-05 00:00:00', 2009, 0, 1, 7, '早上起床睡眼惺忪敗肝敗腎在過生活\r\n\r\n白天研究拿好成績晚上寫歌陪女朋友\r\n\r\n你今天結屎臉   哈哈又被老闆訂了\r\n\r\n還是去游泳又遇到大變態正在摸你大腿\r\n\r\n你玩了四個團然後要蓋間工作室   \r\n\r\n完成音樂的夢想然後養活你自己\r\n\r\n還有一個常常打魔獸住在林口的少年\r\n\r\n說好的新歌呢？\r\n\r\n他牽個女孩 大搖大擺走過來\r\n\r\n女孩說他彈solo的時候好帥\r\n\r\n他笑得燦爛  後照鏡掉下來\r\n\r\nEverybody does want a good time\r\n\r\n(chorus)\r\n\r\nEverybody does need a good time \r\n\r\nto figure out the way of life\r\n\r\nOh life may not be easy and smooth going \r\n\r\nbut nothing can make you dry.        \r\n\r\n一起拋下你的眼鏡和焦慮\r\n\r\n蒸發瀰漫全身的怨氣\r\n', '', 198, '', 'the Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:52:23', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19591, 19520, 2135, 9, 'Eat Shit', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, 'EAT SHIT \r\n\r\nEAT SHIT\r\n\r\nEAT SHIT\r\n\r\nIt''s time to have your breakfast.\r\n\r\nCause you are worth of it\r\n\r\n', '', 288, '', 'the Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:54:14', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19592, 19520, 2135, 4, '陌生人', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, 'That is too much you''ve given\r\n\r\nToo much I''ve taken\r\n\r\nI know you''re waiting\r\n\r\nand that''s why I''m trying\r\n\r\n*We could be strangers, and we are\r\n\r\nBut I won''t resist\r\n\r\nto take away the must\r\n\r\nI''m going to become\r\n\r\nmore like who I really am.\r\n\r\nBut I love you\r\n\r\n(chorus)  \r\n\r\nIt would be easy and simple\r\n\r\nwithout the value\r\n\r\nif it is true\r\n\r\nDon''t know\r\n\r\n*I would still try to fulfill you\r\n', '', 244, '', 'the Pixels', '安立', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:55:47', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19593, 19520, 2135, 10, 'Lounge', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '能否把失望的樣子 換個模樣\r\n \r\n你聳著肩\r\n\r\n吐納   和著點酸味的淡淡芬芳\r\n\r\n每一瞬間   事與願違的徬徨\r\n\r\n把疲憊的心扯下\r\n\r\n呼吸帶了點刺痛的緩慢\r\n\r\n想閉上眼\r\n\r\n當期待的所有背向自己\r\n\r\n怎不卻步\r\n\r\n多大的堅強也能使你懷疑\r\n\r\n如何不在乎\r\n\r\n再多一點寧靜\r\n\r\nplease stick with it\r\n', '', 260, '', 'The Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:57:27', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
(19594, 19520, 2135, 11, '穿雨鞋的小女孩', '', '2009-11-05 00:00:00', 2009, 0, 1, 7, '穿雨鞋的小女孩   牽起媽媽的手\r\n\r\n穿雨鞋的女孩  手上\r\n\r\n留下了輕輕指痕\r\n\r\n人行道上走著訴說今天發生的事\r\n\r\n市場旁買了甜食回到熟悉的家樓   \r\n\r\n在夢裡才會想起的場景\r\n\r\n光著腳的女孩   拉起弟弟的手     \r\n\r\n只穿條內褲的弟弟 手上\r\n\r\n留下了甜食的味道\r\n\r\n盯著天花板觀察滴下來的水珠\r\n\r\n快步跑向正在洗碗盤的母親\r\n\r\n爸爸在看著電視\r\n\r\n過好久才想起的故事\r\n', '', 215, '', 'the Pixels', '阿森', '', '獨立製作', '', 1, 1, 0, '2009-11-05 01:58:48', '2015-03-12 13:40:15', '0000-00-00 00:00:00'),
