(19630, 1350, 0, 1, '驕傲demo', '晚秋的況味 冬天的模樣 未上妝的demo 送給我深深思念的人兒...', '2009-11-11 00:00:00', 2000, 0, 2, 7, '轉身上了鎖\r\n回過頭面對著寂寞\r\n喧鬧後的沉默\r\n竟是種安心的解脫\r\n\r\n給我個擁抱\r\n能否把煩惱都忘掉\r\n每一分每一秒\r\n曾獨自承受的煎熬\r\n\r\n當白日被遮掩 隱瞞著漫無邊的謊言\r\n當話語被沉澱 親吻著靜無聲的黑夜\r\n\r\n我們都太驕傲\r\n在人前總盈盈的笑\r\n不想睡不想說\r\n卻渴望夢裡的擁抱\r\n\r\n我們都太驕傲\r\n凝望著過去的美好\r\n在空氣中尋找\r\n記憶裡熟悉的味道\r\n\r\n給你個擁抱\r\n能否把煩惱都忘掉\r\n每一分每一秒\r\n曾獨自承受的煎熬\r\n  \r\n當白日被遮掩 隱瞞著漫無邊的謊言\r\n當思緒被沉澱 親吻著靜無聲的黑夜\r\n\r\n我們都太驕傲\r\n在人前總盈盈的笑\r\n不想睡不想說\r\n卻渴望夢裡的擁抱\r\n\r\n我們都太驕傲\r\n凝望著過去的美好\r\n只想問 誰能夠為我\r\n給你個擁抱\r\n\r\n\r\n', '', 189, '', 'Ayuri', 'Ayuri', '', '霓虹木工作室(Rainbow Wood Studio)', '', 0, 0, 0, '2009-11-11 17:44:27', '2015-03-12 13:40:16', '0000-00-00 00:00:00'),
(19631, 20248, 0, 1, 'when teenage', '', '2009-07-01 00:00:00', 2009, 0, 1, 7, 'when teenage\r\n\r\n\r\n花都開了  天也都亮了\r\n陽光下  制服都乾了\r\n閉上眼的那一座樂園\r\n有我們天真的笑臉\r\n\r\n哼著音樂  你走在前面\r\n那讓我心動的一切\r\n以為幾個和絃  就能統一世界\r\n哪還需要理性那一面\r\n\r\n回到那年  我們的十七歲\r\n炎熱夏天  比誰都還熱血\r\n如果能回到從前  \r\n停留在跨年\r\n煙火是不是一樣美\r\n\r\n地上落葉  像張泛黃的照片\r\n很藍的天  夢想卻還在盤旋\r\n沒時間猶豫不決\r\n得快步向前\r\n別讓未來再次擱淺', '', 239, '', '', '', '', '', '', 0, 0, 1, '2009-11-12 00:55:18', '2013-10-07 17:15:17', '0000-00-00 00:00:00'),
