(19640, 20298, 2144, 1, '媽媽(2009年母親節紀念)', '', '2009-11-13 00:00:00', 2008, 0, 2, 7, '', '媽媽       詞/曲/編曲/演唱 : 王翰  \n\n\n小時後牽著媽媽的手\n她說上帝賜給她一個我\n不明白  那是什麼東東\n我小小腦袋怎都猜不透\n\n\n長大後我開始慢慢能懂\n上帝賜一個媽媽給我\n不簡單  照顧麻煩的我\n我想來想去不知該回報什麼\n\n\n\n媽媽告訴我 她要的其實不多\n健健康康快快樂樂長大就夠\n她無時無刻保護著我 \n小小的手是我大大的天空\n媽媽很囉唆 常讓我煩到頭痛\n可是我知道這是屬於她的溫柔\n不懂得感激是我的錯\n媽咪的愛心 其實我都懂\n\n\n媽媽總把最好的留給我 \n再辛苦艱難也自己忍受\n不明白 這份愛的源頭\n媽媽像個天使在我身旁守候\n\n\n不知不覺時間悄悄溜走\n孩子我慢慢長大成熟\n不簡單  看著媽媽笑容\n好像所有壓力重擔都消失無蹤 ', 306, '', '', '', '王翰', '', '', 0, 0, 0, '2009-11-13 20:26:01', '2015-03-12 13:40:17', '0000-00-00 00:00:00'),
